import styled from 'styled-components';

export const Container = styled.div`
  max-width: 1270px;
    margin: 0 auto;
    position: relative;
    padding: 0 20px;
`;


export const GoBack = styled.div`
  display: flex;
  flex-flow: row wrap;
  justify-content: flex-start;
  margin-top: 12px;

  @media ${device.laptop} { 
    justify-content: center;
    margin: 22px;
  }
`;
